import React from 'react';
import { Link } from "@reach/router";

const Header = () => {

    return (
        <div className="header">
            <div className="headerLeft" style={{"display": "flex", "alignContent": "baseline"}}>
                <h2><Link to="/players/list">Manage Players</Link></h2>
                <div className="divider"></div>
                <h2><Link to="/players/addplayer">Manage Player Status</Link></h2>
            </div>
            <img src="https://upload.wikimedia.org/wikipedia/en/thumb/7/7a/Manchester_United_FC_crest.svg/1200px-Manchester_United_FC_crest.svg.png" alt="emblem"></img>
        </div>
    )
}

export default Header;
